import Link from 'next/link';

const linkStyle = {
    marginRight: 15
}

const Header = () => (
    <div>
        <Link href="/">
            <a style={linkStyle}>Home</a>
        </Link>
        <Link href="/jpy">
            <a style={linkStyle}>USD</a>
        </Link>
        <Link href="/usd">
            <a style={linkStyle}>JPY</a>
        </Link>
    </div>
)

export default Header;
